import React, { useEffect, useState } from 'react';
import { useParams } from "react-router-dom"
import classes from './ProductPage.module.css';

export default function ProductPage() {
    const {id} = useParams();
  return (
    <main className={classes.contacts__container}>
        <h3>Продукт № {id}</h3>
    </main>
  );
}
